import React from 'react';
import Grid from '@material-ui/core/Grid';
import '../styles/Home.css';
import aakanksha_pic from '../resources/aakanksha_pic.png'
import Navbar from '../components/Navbar'
import ReactTextRotator from 'react-text-rotator';

const content = [
    {
      text: ' Aakanksha N S',
      className: 'about-text',
      animation: 'fade'
    },
    {
      text: ' a Data Scientist',
      className: 'about-text',
      animation: 'fade',
    },
    {
        text: ' a Software Engineer',
        className: 'about-text',
        animation: 'fade',
    },
    {
        text: ' a Web Developer',
        className: 'about-text',
        animation: 'fade',
    }
  ];

const Home = () => (
    <Grid container spacing={3}>
        <Grid item xs={12}>
            <Navbar/>
        </Grid>
        <Grid item xs={12} sm={6}>
            <div>
                <img src={aakanksha_pic} alt="Home pic" className="my-pic"/>
            </div>
        </Grid>
        <Grid item xs={12} sm={6}>
            <div className='about-text'>
                I am
                <ReactTextRotator
                    content={content}
                    time={3000}
                    startDelay={100}
                />
            </div>
        </Grid>
    </Grid>
);

export default Home;
